import React from 'react';

export default function ToggleTodo({ id, setTodoList }) {
  const onToggleTodo = (event) => {
    console.log(event.target.value);
  };
  return (
    <>
      <input type='checkbox' onChange={(event) => onToggleTodo(event)} />
    </>
  );
}
